import React from 'react';
import {PageWrapper,PageView} from "../../../common/DesignConstants"
import PageTitle from "../../UIs/PageTitle"

const application = () => {
 return (
  <PageWrapper>
   <PageTitle 
    title='Student Dashboard'
    homePath='dashboard'
    page='Apply'
   />
   <PageView>
      applications
   </PageView>
  </PageWrapper>
 );
};

export default application;
